import React from 'react';
import styled from 'styled-components';

const IndexPage = () => {
    return <StyledLayout>IndexPage</StyledLayout>;
};

export default IndexPage;

export const StyledLayout = styled.div`
    margin: 0;
    padding: 0;
    box-sizing: border-box;
`;
